  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lake Andes Wetland
  Management District outlines District accomplishments during the 1985 calendar year.
  The report begins with an introduction to the District and information about weather
  conditions, land acquisition activities, planning, research and investigations.
  The planning section discusses personnel, youth programs, volunteer programs, funding,
  and safety. Habitat management is covered; wetlands, croplands, grasslands, grazing,
  haying, fire management, vegetation control, water rights, and easements for waterfowl
  management are discussed. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, migratory birds, game mammals, raptors,
  and disease prevention and control. Interpretation and recreation activities are
  outlined; topics include information and interpretation, recreation, and law enforcement.
  The equipment and facilities section discusses new construction, rehabilitation,
  and major maintenance. Items of interest, photographs, and brochures are attached.\",\n\t\"owner_org\":
